export const getPercentColor = (percent) => {
    //alert("percent="+percent)
    percent = percent.replace(/%/g, '');
    let red = '#ff0000';
    let orange = '#ff9900';
    let yellow = '#fdfa06';
    let blue = '#0080FF';
    let green = '#00ff00';
    let purple = '#ff00ff';
    if (isNaN(percent) || percent > 90){
      return purple;
    } 
    if (percent > 85) {
      return blue;
    }
    if (percent > 55) {
      return green;
    }
    if (percent > 35) {
      return yellow;
    }
    if (percent > 20) {
      return orange;
    }
    return red;
  };
